import React, { Component } from 'react';
import Axios from 'axios';

import CustomerList from './CustomerList';
import * as ServiceUtils from './../Utils/ServiceUtils';

export default class GetList2 extends Component {
    constructor() {
        super();
        this.state = {
            customers: [],
        };
    }
   componentWillMount() {
      debugger;
    let incomingResponse = ServiceUtils.getRequest('http://localhost:59982/api/Customer/GetList');
    debugger;
    console.log('incomingResponse in ComponentWillMount = ' + incomingResponse );
    this.setState({customers:incomingResponse});
    }




    render() {
        return (
            <div>
                <CustomerList
                data={this.state.customers}
                />
            </div>
        )
    }
};
